CREATE TABLE IF NOT EXISTS `users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_socket` int(11) DEFAULT NULL,
  `settings_sound` int(3) NOT NULL DEFAULT '100',
  `login_ticket` varchar(155) DEFAULT NULL,
  `login_session` varchar(41) DEFAULT NULL,
  `name` varchar(15) NOT NULL,
  `nickname` varchar(15) DEFAULT '',
  `language` varchar(5) NOT NULL DEFAULT 'DE',
  `email` varchar(48) NOT NULL,
  `email_validated` enum('1','0') NOT NULL DEFAULT '0',
  `password` varchar(40) NOT NULL,
  `accept_friends` enum('1','0') NOT NULL DEFAULT '1' COMMENT 'Separate sign is a comma',
  `merge_name` enum('0','1') NOT NULL DEFAULT '0',
  `tutorial_name` enum('0','1') NOT NULL DEFAULT '0',
  `tutorial_clothes` enum('0','1') NOT NULL DEFAULT '0',
  `tutorial_guide` enum('0','1') NOT NULL DEFAULT '0',
  `birth` varchar(10) NOT NULL,
  `create_time` int(11) NOT NULL DEFAULT '0',
  `lastonline_time` int(11) NOT NULL DEFAULT '0',
  `online_time` int(11) NOT NULL DEFAULT '0',
  `update_time` int(11) NOT NULL DEFAULT '0',
  `has_housekeeping` enum('0','1') NOT NULL DEFAULT '0',
  `privileges_extra` varchar(255) NOT NULL COMMENT 'Separate sign is ;',
  `level` int(20) NOT NULL DEFAULT '0',
  `level_hc` int(1) NOT NULL DEFAULT '0',
  `hc_startperiod` int(11) NOT NULL DEFAULT '0',
  `hc_days` int(11) NOT NULL DEFAULT '0',
  `hc2_days` int(11) NOT NULL DEFAULT '0',
  `hc_periods` int(11) NOT NULL DEFAULT '0',
  `hc2_periods` int(11) NOT NULL DEFAULT '0',
  `hc_presents` int(11) NOT NULL DEFAULT '0',
  `homeroom` int(11) NOT NULL DEFAULT '0',
  `motto` varchar(45) NOT NULL,
  `figure` varchar(255) NOT NULL,
  `gender` enum('m','f') NOT NULL,
  `credits` int(11) NOT NULL DEFAULT '500',
  `activitypoints_0` int(11) NOT NULL DEFAULT '0' COMMENT 'Pixels',
  `activitypoints_1` int(11) NOT NULL DEFAULT '0' COMMENT 'Snowflakes',
  `activitypoints_2` int(11) NOT NULL,
  `activitypoints_3` int(11) NOT NULL DEFAULT '0',
  `activitypoints_4` int(11) NOT NULL DEFAULT '0',
  `respect_received` int(11) NOT NULL DEFAULT '0',
  `respect_given` int(11) NOT NULL DEFAULT '0',
  `respect_amount` int(11) NOT NULL DEFAULT '3',
  `gifts_given` int(11) NOT NULL DEFAULT '0',
  `gifts_received` int(11) NOT NULL DEFAULT '0',
  `scratch_given` int(11) NOT NULL DEFAULT '0',
  `scratch_amount` int(11) NOT NULL DEFAULT '3',
  `amount_staffpicked` int(11) NOT NULL DEFAULT '0',
  `achievement_score` int(11) NOT NULL,
  `id_favgroup` int(11) NOT NULL,
  `ip_last` varchar(30) NOT NULL,
  `ip_reg` varchar(30) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`),
  UNIQUE KEY `login_ticket` (`login_ticket`),
  UNIQUE KEY `login_session` (`login_session`),
  KEY `level` (`level`),
  KEY `level_hc` (`level_hc`),
  KEY `language` (`language`),
  KEY `id_socket` (`id_socket`),
  KEY `password` (`password`),
  KEY `privileges_extra` (`privileges_extra`),
  KEY `accept_friends` (`accept_friends`),
  KEY `activitypoints_2` (`activitypoints_2`),
  KEY `activitypoints_1` (`activitypoints_1`),
  KEY `activitypoints_0` (`activitypoints_0`),
  KEY `activitypoints_3` (`activitypoints_3`),
  KEY `activitypoints_4` (`activitypoints_4`)
) ENGINE=InnoDB  DEFAULT CHARSET=latin1 AUTO_INCREMENT=9 ;

