(1, 1, NULL, '', 9, 18, '0', 2, 'hd-180-7.ch-235-82.lg-280-64.sh-300-64.hr-165-39', 'James', 'Willkommen im Habbo!', 'Willkommen im Habbo, brauchst du Hilfe?\\nWer schreit der lügt.', '', 'hi;Hey! Wie kann ich dir helfen?\\nhey;Hey! Wie kann ich dir helfen?\\nhello;Hey! Wie kann ich dir helfen?\\ncocktail;Bitte. Genieße den Cocktail!{SERVE_24}\\njames;Das bin ich. Wie kann ich dir helfen?\\ncola;Bitte. Genieße deine Cola!{SERVE_19}\\ncola;Bitte. Genieße deine Cola!{SERVE_19}\\nwater;Bitte. Ein stilles Wasser für dich!{SERVE_7}\\ncoffee;Achtung. Der Kaffee ist heiß!{SERVE_11};Bitte!{SERVE_12};Bitte!{SERVE_13};Bitte!{SERVE_14}\\njuice;Bitte!{SERVE_2}\\nchampagne;Bitte!{SERVE_31}', '0', 9, '0', 0),
(5, 0, NULL, '', 0, 0, '0.0', 0, 'hr-836-61.hd-600-2.ch-824-110.lg-695-110.sh-730-110.he-1607-', 'Guide Bot', 'Hier um zu helfen!', 'Für die Möbel im Katalog brauchst du Taler. Diese bekommst du dutrch Events im Hotel!\\nGetting Neue Freunde finden ist ganz einfach. Gehe in einen Raum und unterhalte dich mit anderen Usern.\\nWas ein tolles Wetter, oder? :)\\nDu kannst mich aus dem Raum kicken wenn du keine weitere Hilfe benötigst.\\nAuch Tauschen kannst du hier. Werde ein reicher Habbo.', 'Hi, Willkommen im Habbo! Ich bin der Guide Bot und hier um dir zu helfen.\\nIch kann dir ein paar der wichtigsten Fragen beantworten. Stell mir einfach eine Frage. :)', 'hi;Hey! Willkommen im Habbo.\\nhi;Hey! Willkommen im Habbo.\\nhey;Hey! Willkommen im Habbo.\\nbye;Bye Bye!\\ntaler;Habbo ist kostenlos. Wenn du aber unsere Zusatzfunktionen nutzen möchtest, informiere dich auf unserer Homepage zu den Möglichkeiten.\\nstaff;Habbo Staff sind die Helfer und Leiter dieses Hotels.\\nrares;Rare sind Möbelstücke mit sehr hohem Wert.\\n*****;***** ist die Zeichenkombination, durch welches Wörter durch den Wortfilter ersetzt werden.', '1', 9, '0', 0),
