INSERT INTO `catalog_pages` (`id`, `id_order`, `id_parent`, `name`, `level_minrequired`, `hclevel_minrequired`, `is_visible`, `is_develop`, `is_clickable`, `ctlg_template`, `ctlg_special_template`, `ctlg_icon`, `ctlg_color`, `ctlg_txt1`, `ctlg_txt2`, `ctlg_txt3`, `ctlg_txt4`, `ctlg_txt5`, `ctlg_txt6`, `ctlg_txt7`, `ctlg_txt8`, `ctlg_txt9`, `ctlg_txt10`, `ctlg_txt11`, `ctlg_link`, `ctlg_header_img`, `ctlg_special_img`) VALUES
(1, 0, 0, 'Hauptseite', 0, 0, '1', '0', '1', 'frontpage3', '', 1, 12, 'Taler ausgegangen?', 'Du kannst Pixel in Taler umwandeln.', 'Weitere Informationen >', 'Was ist unsere Währung?', 'Pixel: Mit Pixel kannst du alle normalen Möbel und Sammlerstücke erwerben.\\n\\nHabbo Taler: Mit Taler kannst du Pokale, Haustiere, Spiele und weitere coole Dinge kaufen. Pixels lassen sich auch in Taler umwandeln.', 'Gutschrift einlösen:', 'Pixel umwandeln', '#FFFFFF', '#FFFFFF', 'Möbelstücke-Shop öffnen >>', 'Möbelstücke', 'Exklusive', 'catalog_frontpage_headline2_de', 'top_story_credits.png?'),
(2, 1, 0, 'Habbo Club', 0, 0, '1', '0', '1', 'default_3x3', 'NULL', 75, 11, 'Vorteile im Club: 5 Club Geschenke monatlich + Spezielle Kommandos wie :chooser und :furni + HC Badge + Club Shop + viele weitere Vorteile', 'Wähle die Mitgliedschaftslänge!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 'hc2_clubtitle', 'ctlg_hw_teaser_en'),
(3, 2, 501, 'VIP Club', 0, 0, '1', '0', '1', 'default_3x3', 'NULL', 198, 0, 'VIP Vorteile sind: 30 Club oder VIP Geschenke monatlich + Spezielle Kommandos wie :copyfigure, :whosonline, :chooser und :furni + VIP und HC Badge nach 1 Monat + Club Shop + viele weitere Vorteile', 'Wähle die Mitgliedschaftslänge!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 'vip_clubtitle', 'ctlg_hw_teaser_en'),
(4, 0, 53, 'Böden und Tapeten', 0, 0, '1', '0', '1', 'spaces_new', 'NULL', 55, 0, 'Mit Bodenbelag, Wandfarbe und Landschaft hinter den Fenstern ist die Grundausstattung perfekt.', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'look_feel_text', 'NULL'),
(5, 0, 53, 'Fenster', 0, 0, '1', '0', '1', 'default_3x3', 'catalog_special_txtbg2', 63, 0, 'Lass ein wenig Sonne rein! Die Fenster in verschiedenen Styles ermöglichen dir einen tollen Ausblick.', 'Für mehr Details einfach anklicken!', 'Welch eine Aussicht!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 'ctlg_windows_headline1_en', 'ctlg_windows_teaser1_en'),
(7, 0, 53, 'Mode', 0, 0, '1', '0', '1', 'default_3x3', 'catalog_special_txtbg2', 39, 0, 'Durchdachte Funktionalität kombiniert mit glatter, bwquemer Polsterung. Etwas für Grossstädter!', 'Für mehr Details einfach anklicken!', 'Schönes Design!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 'catalog_mode_headline1', 'catalog_mode_teaser1'),
(8, 0, 53, 'Candy', 0, 0, '1', '0', '1', 'default_3x3', 'catalog_special_txtbg2', 19, 0, 'Candy kombiniert die coolen und klaren Linien der Mode-Kollektion mit einem sanfteren, weiblicheren Stil. Für die, dieklare Linien mit verspielten Elementen lieben.', 'Für mehr Details einfach anklicken!', 'Keine Angst, das ist kein echtes Fell!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 'catalog_candy_headline1', 'catalog_candy_teaser1'),
(9, 0, 53, 'Glass', 0, 0, '1', '0', '1', 'default_3x3', 'catalog_special_txtbg2', 29, 0, 'Klares, handgearbeitetes Glas.', 'Für mehr Details einfach anklicken!', 'Vorsicht zerbrechlich!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 'catalog_gls_headline1', 'catalog_glass_teaser1'),
(10, 0, 53, 'Pura', 0, 0, '1', '0', '1', 'default_3x3', 'catalog_special_txtbg2', 48, 0, 'Diese Kollektion bringt eine angenehme Ruhe in deinen Raum. Schaffe dir einen Ruhepol fernab von Jubel und Trubel der Hotelräume.', 'Für mehr Details einfach anklicken!', 'Pura Styla!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 'catalog_pura_headline1', 'catalog_pura_teaser1'),
(11, 0, 53, 'Area', 0, 0, '1', '0', '1', 'default_3x3', 'catalog_special_txtbg2', 14, 0, 'Klare Linien zeichnen diese Kollektion für den bodenständigen Habbo aus. Wunderschön in ihrer Einfachheit. In schwarz, weiss und gelb.', 'Für mehr Details einfach anklicken!', 'Einfach aber schön!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 'catalog_area_headline1', 'catalog_area_teaser1'),
(12, 0, 53, 'Landhaus', 0, 0, '1', '0', '1', 'default_3x3', 'catalog_special_txtbg2', 37, 0, 'Für den Hütteneffekt - am besten mit einem offenen Kamin. Diese Kollektion ist für Habbos, die es gerne gemütlich haben.', 'Für mehr Details einfach anklicken!', 'Aufwärmen nach dem Skifahren!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 'catalog_lodge_headline1', 'catalog_lodge_teaser1'),
(13, 0, 53, 'Flower Power', 0, 0, '1', '0', '1', 'default_3x3', 'catalog_special_txtbg2', 45, 0, 'Jeder Raum braucht Pflanzen! Diese bringen nicht nur etwas Natur in den Raum, sondern verbessern auch die Luftqualität!', 'Für mehr Details einfach anklicken!', 'Ab und zu mal gießen!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 'catalog_flowerpower_header_de', 'garden_teaser_en'),
(14, 0, 53, 'Landleben', 0, 0, '1', '0', '1', 'default_3x3', 'catalog_special_txtbg2', 21, 0, 'Die Schnauze voll von der Stadt? Kein Problem, raus an die frische Luft mit der neuen Landleben Kollektion ...', 'Für mehr Details einfach anklicken!', 'Farmerama!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 'country_header1_en_001', 'country_teaser1'),
(15, 0, 53, 'Plastic', 0, 0, '1', '0', '1', 'plasto', '', 46, 0, 'Mach eine Reise zurück in die 70er! Wähle die Farbe, die du am liebsten magst oder die, die gerade deiner Laune entspricht!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 'catalog_plasto_headline1', ''),
(16, 0, 2, 'Club Geschenke', 0, 0, '1', '0', '1', 'club_gifts', 'NULL', 75, 0, 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'hc2_clubtitle', 'NULL'),
(17, 0, 53, 'Bad', 0, 0, '1', '0', '1', 'default_3x3', 'catalog_special_txtbg2', 17, 0, 'Lust auf ein ausgedehntes Bad? Na, dann lass das Wasser ein! Wichtiger Tipp, um schlechte Gerüche zu vermeiden: Stell dein Klo eine Ecke!', 'Für mehr Details einfach anklicken!', 'Jeder Habbo braucht eins!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 'catalog_bath_headline1', 'catalog_bath_teaser1'),
